import React, { Component } from 'react'

export class MoviesButton extends Component {
 render() {
  return (
   <React.Fragment>
    <button
      onClick={this.props.getMovies}
      className='nextBtn'>
      Get Favorite Movies
    </button>
    </React.Fragment>
   )
 }
}

export default MoviesButton
